import React from 'react';
import '../Sass/Components/_weeklyTracker.scss';

class WeeklyTracker extends React.Component {

    currentDayValues = {
        Sun: this.props.weeklyTrack[0],
        Mon: this.props.weeklyTrack[1],
        Tue: this.props.weeklyTrack[2],
        Wed: this.props.weeklyTrack[3],
        Thu: this.props.weeklyTrack[4],
        Fri: this.props.weeklyTrack[5],
        Sat: this.props.weeklyTrack[6]
    }


    render() {

        const weeklyTrack = {...this.props.weeklyTrack}

        return (
            <div className="tracker-wrap">
                <h2>Weekly Progress</h2>
                <div className="week-prog-wrap">
                        {Object.keys(this.props.weeklyTrack).map(key => 
                            console.log(this.props.weeklyTrack))};
                </div>
            </div>
        )

    }
}

export default WeeklyTracker;
